import React from 'react'
import { Link } from 'react-router-dom';
import logo from '../../assets/img/logo.png';

export const Logo = () => {
  return (
    <Link to="/">
       <img src={logo} className="w-20 h-20" alt="" />
    </Link>
  )
}
